import axios from "axios";
import { showAlert } from "./alerts";

export const updateSettings = async (name, email) => {
  try {
    const res = await axios({
      method: "PATCH",
      url: "http://127.0.0.1:3000/api/v1/users/updateMe",
      data: {
        name,
        email,
      },
    });
  } catch (err) {
    showAlert("err", err.respone.data.message);
  }
};
